import React, { useState, useEffect } from "react";
import "./Modal.css";

function InvoiceModal({ isOpen, toggleModal }) {
  // State variables for form fields
  const [paymentDate, setPaymentDate] = useState("");
  const [description, setDescription] = useState("");
  const [price, setPrice] = useState("");
  const [supplierId, setSupplierId] = useState("");
  const [file, setFile] = useState(null);

  // State variables for error messages
  const [paymentDateError, setPaymentDateError] = useState("");
  const [descriptionError, setDescriptionError] = useState("");
  const [priceError, setPriceError] = useState("");
  const [supplierIdError, setSupplierIdError] = useState("");

  // Reset form fields and errors when modal is closed
  useEffect(() => {
    if (!isOpen) {
      setPaymentDate("");
      setDescription("");
      setPrice("");
      setSupplierId("");
      setFile(null);
      setPaymentDateError("");
      setDescriptionError("");
      setPriceError("");
      setSupplierIdError("");
    }
  }, [isOpen]);

  // Handle file input change
  const handleFileChange = (e) => {
    setFile(e.target.files[0]);
  };

  // Function to handle form submission with validation
  const handleSubmit = (e) => {
    e.preventDefault();
    let isValid = true;

    // Validation for each field
    if (!paymentDate) {
      setPaymentDateError("Prosím, zadajte dátum úhrady.");
      isValid = false;
    } else {
      setPaymentDateError("");
    }

    if (!description.trim()) {
      setDescriptionError("Prosím, zadajte popis.");
      isValid = false;
    } else {
      setDescriptionError("");
    }

    if (!price || isNaN(price) || parseFloat(price) <= 0) {
      setPriceError("Prosím, zadajte platnú cenu.");
      isValid = false;
    } else {
      setPriceError("");
    }

    if (!supplierId.trim()) {
      setSupplierIdError("Prosím, zadajte IČO dodávateľa.");
      isValid = false;
    } else {
      setSupplierIdError("");
    }

    // Stop submission if validation failed
    if (!isValid) return;

    // Reset form fields on successful submission
    setPaymentDate("");
    setDescription("");
    setPrice("");
    setSupplierId("");
    setFile(null);
    toggleModal(); // Close modal
  };

  // Don't render the modal if it is not open
  if (!isOpen) return null;

  return (
    <div className="modal-overlay" onClick={toggleModal}>
      <div
        className="modal-content faktury-modal"
        onClick={(e) => e.stopPropagation()} // Prevents closing when clicking inside modal
      >
        <h2>Pridať uhradenú faktúru</h2>
        <form onSubmit={handleSubmit}>
          <label>
            Dátum úhrady
            <input
              type="date"
              value={paymentDate}
              onChange={(e) => setPaymentDate(e.target.value)}
              className="input-date"
            />
            {paymentDateError && <span className="error-message">{paymentDateError}</span>}
          </label>
          <label>
            <input
              type="text"
              placeholder="Popis"
              value={description}
              onChange={(e) => setDescription(e.target.value)}
              className="input-description"
            />
            {descriptionError && <span className="error-message">{descriptionError}</span>}
          </label>
          <label>
            <input
              type="number"
              placeholder="Cena"
              value={price}
              onChange={(e) => setPrice(e.target.value)}
              min="0"
              className="input-price"
            />
            {priceError && <span className="error-message">{priceError}</span>}
          </label>
          <label>
            <input
              type="text"
              placeholder="IČO dodávateľa"
              value={supplierId}
              onChange={(e) => setSupplierId(e.target.value)}
              className="input-supplier-id"
            />
            {supplierIdError && <span className="error-message">{supplierIdError}</span>}
          </label>

          <div className="button-container">
            <label
              htmlFor="file-upload"
              className="custom-upload-button"
              onMouseEnter={() => setShowTooltip(true)}
              onMouseLeave={() => setShowTooltip(false)}
              onMouseMove={handleMouseMove}
            >
              <img src="./Upload.svg" alt="Upload Icon" className="upload-icon" />
              {showTooltip && (
                <span
                  className="tooltip"
                  style={{
                    top: mousePosition.y + 15,
                    left: mousePosition.x + 15,
                  }}
                >
                  Pridaj fotku faktúry
                </span>
              )}
            </label>

            {/* Hidden file input for file upload */}
            <input
              type="file"
              id="file-upload"
              className="input-upload"
              style={{ display: "none" }}
              onChange={handleFileChange}
            />

            <button type="submit" className="submit-btn">
              Odošli
            </button>
          </div>
        </form>

        <button className="close-btn" onClick={toggleModal}>
          X
        </button>
      </div>
    </div>
  );
}

export default InvoiceModal;
